    async function fetchAnimals(){
      const response = await fetch();
      const data = await response.json();
      setAnimal(data);
    }
  },[])



  return (
    <main>
      <section className='max-w-7xl mx-auto py-7'>
        <div className='flex juistify-start flex-wrap'>
          <AnimalCard/>

        </div>

      </section>
    </main>

  )
}
